import React, { useEffect, useState } from 'react';
import { getData } from './services/service';

const Main = () => {
    const [data, setData] = useState([]);
    useEffect(() => {
        getData().then((res) => {
            setData(res.data);
            console.log(res.data);
        });
    }, [])
    return (
        <>
        <table style={{border:"1px solid"}}>
        <tr>
          <th>first Name</th> 
          <th>Last Name</th>
          <th>Middle Name</th>
          <th>Address</th>
          <th>State</th> 
        </tr>
            {data.map((item, index) => {
                return (
                    <tr key={index}>
                        <td >First Name: {item.first_name}</td>
                        <td >Last Name: {item.last_name}</td>
                        <td >Middle Name: {item.middle_name}</td>
                        <td >Address: {item.address}</td>
                        <td >State: {item.state}</td>
                    </tr>
                );
            })}
            </table>
        </>
    );
};

export default Main;
